Description:
The following statement contains a magic number: Invoke((MethodInvoker)(() =>                                          {                                              _messages.Add(message);                                                if (Settings.Default.MaxMessages > 0)                                              {                                                  while (_messages.Count > Settings.Default.MaxMessages)                                                  {                                                      _messages.RemoveAt(0);                                                  }                                              }                                                if (Settings.Default.AutoViewNewMessages ||                                                  Settings.Default.AutoInspectNewMessages)                                              {                                                  if (Settings.Default.AutoViewNewMessages)                                                  {                                                      ViewMessage(message);                                                  }                                                    if (Settings.Default.AutoInspectNewMessages)                                                  {                                                      InspectMessage(message);                                                  }                                              }                                              else if (!Visible && Settings.Default.BalloonNotifications)                                              {                                                  string body =                                                      string.Format(                                                          "From: {0}
To: {1}
Subject: {2}
<Click here to view more details>"'                                                          message.From'                                                          message.To'                                                          message.Subject);                                                    trayIcon.ShowBalloonTip(3000' "Message Received"' body' ToolTipIcon.Info);                                              }                                                if (Visible && Settings.Default.BringToFrontOnNewMessage)                                              {                                                  BringToFront();                                                  Activate();                                              }                                          }));
